name: USA
smh_round: "R11"
start_date: 2020-01-01
end_date: 2022-06-18
end_date_groundtruth: 2021-12-18
nsimulations: 300
dt: 1.000

spatial_setup:
  census_year: 2019
  base_path: data
  modeled_states:
    - AK
    - AL
    - AR
    - AZ
    - CA
    - CO
    - CT
    - DC
    - DE
    - FL
    - GA
    - HI
    - IA
    - ID
    - IL
    - IN
    - KS
    - KY
    - LA
    - MA
    - MD
    - ME
    - MI
    - MN
    - MO
    - MS
    - MT
    - NC
    - ND
    - NE
    - NH
    - NJ
    - NM
    - NV
    - NY
    - OH
    - OK
    - OR
    - PA
    - RI
    - SC
    - SD
    - TN
    - TX
    - UT
    - VA
    - VT
    - WA
    - WI
    - WV
    - WY
  setup_name: SMH
  geodata: geodata_2019_statelevel.csv
  mobility: mobility_2011-2015_statelevel.csv
  popnodes: pop2019est
  nodenames: geoid
  include_in_report: include_in_report
  state_level: TRUE

seeding:
  variant_filename: data/variant/variant_props_long.csv
  seeding_compartments:
    WILD:
      source_compartment: ["S", "unvaccinated", "WILD", "age18to64"]
      destination_compartment: ["E", "unvaccinated", "WILD", "age18to64"]
    ALPHA:
      source_compartment: ["S", "unvaccinated", "WILD", "age18to64"]
      destination_compartment: ["E", "unvaccinated", "ALPHA", "age18to64"]
    DELTA:
      source_compartment: ["S", "unvaccinated", "WILD", "age18to64"]
      destination_compartment: ["E", "unvaccinated", "DELTA", "age18to64"]
    OMICRON:
      source_compartment: ["S", "unvaccinated", "WILD", "age18to64"]
      destination_compartment: ["E", "unvaccinated", "OMICRON", "age18to64"]
  method: FolderDraw
  seeding_file_type: seed
  folder_path: importation/minimal/
  lambda_file: data/seeding_territories.csv
  pop_seed_file: data/seeding_agestrat.csv
  date_sd: 0
  amount_sd: 1


seir:
  integration_method: rk4
  parameters:
    sigma:
      value:
        distribution: fixed
        value: 0.192307692307692
    alpha:
      value:
        distribution: fixed
        value: 0.99
    r0:
      value:
        distribution: fixed
        value: 2.3
    gamma:
      value:
        distribution: uniform
        low: 0.222222222222222
        high: 0.333333333333333
    theta1_WILD:
      value:
        distribution: fixed
        value: 1 - 0.6
    theta2_WILD:
      value:
        distribution: fixed
        value: 1 - 0.85
    theta1_ALPHA:
      value:
        distribution: fixed
        value: 1 - 0.6
    theta2_ALPHA:
      value:
        distribution: fixed
        value: 1 - 0.85
    theta1_DELTA:
      value:
        distribution: fixed
        value: 1 - 0.5
    theta2_DELTA:
      value:
        distribution: fixed
        value: 1 - 0.8
    theta1_OMICRON:
      value:
        distribution: fixed
        value: 1 - 0.10
    theta2_OMICRON:
      value:
        distribution: fixed
        value: 1 - 0.16
    thetaW_age0to17:
      value:
        distribution: fixed
        value: 1 - 0.55
    thetaW_age18to64:
      value:
        distribution: fixed
        value: 1 - 0.55
    thetaW_age65to100:
      value:
        distribution: fixed
        value: 1 - 0.48
    thetaW_age0to17_OMICRON:
      value:
        distribution: fixed
        value: 1 - 0.110
    thetaW_age18to64_OMICRON:
      value:
        distribution: fixed
        value: 1 - 0.110
    thetaW_age65to100_OMICRON:
      value:
        distribution: fixed
        value: 1 - 0.096
    nu1age0to17:
      intervention_overlap_operation: sum
      value:
        distribution: fixed
        value: 0
    nu3age0to17:
      intervention_overlap_operation: sum
      value:
        distribution: fixed
        value: 0
    nu1age18to64:
      intervention_overlap_operation: sum
      value:
        distribution: fixed
        value: 0
    nu3age18to64:
      intervention_overlap_operation: sum
      value:
        distribution: fixed
        value: 0
    nu1age65to100:
      intervention_overlap_operation: sum
      value:
        distribution: fixed
        value: 0
    nu3age65to100:
      intervention_overlap_operation: sum
      value:
        distribution: fixed
        value: 0
    nu2:
      intervention_overlap_operation: sum
      value:
        distribution: fixed
        value: 0.0408
    chi1:
      value:
        distribution: fixed
        value: 1.5
    chi2:
      value:
        distribution: fixed
        value: 2.4
    chi3:
      value:
        distribution: fixed
        value: 2.4
    epsilon:
      value:
        distribution: fixed
        value: 0.005479
  compartments:
    infection_stage: ["S", "E", "I1", "I2", "I3", "R", "W"]
    vaccination_stage: ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
    variant_type: ["WILD", "ALPHA", "DELTA", "OMICRON"]
    age_strata: ["age0to17", "age18to64", "age65to100"]

  transitions:
# 1. Susceptibles (S) Exposed (E) to WILD, excluding waned
    - source: [["S"],["unvaccinated", "1dose", "2dose"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["unvaccinated", "1dose", "2dose"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["WILD"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1", "theta1_WILD", "theta2_WILD"],
        ["1"],
        ["1","1","1"]
      ]

# 2. Susceptibles (S) Exposed (E) to ALPHA, excluding waned
    - source: [["S"],["unvaccinated", "1dose", "2dose"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["unvaccinated", "1dose", "2dose"],["ALPHA"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["ALPHA"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1", "theta1_ALPHA", "theta2_ALPHA"],
        ["chi1"],
        ["1","1","1"]
      ]

# 3. Susceptibles (S) Exposed (E) to DELTA, excluding waned
    - source: [["S"],["unvaccinated", "1dose", "2dose"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["unvaccinated", "1dose", "2dose"],["DELTA"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["DELTA"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1", "theta1_DELTA", "theta2_DELTA"],
        ["chi2"],
        ["1","1","1"]
      ]

# 3B. Susceptibles (S) Exposed (E) to OMICRON, excluding waned
    - source: [["S"],["unvaccinated", "1dose", "2dose"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["unvaccinated", "1dose", "2dose"],["OMICRON"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["OMICRON"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1", "theta1_OMICRON", "theta2_OMICRON"],
        ["chi3"],
        ["1","1","1"]
      ]

# 4. Susceptibles (S) to Exposed (E) to WILD/ALPHA/DELTA for waned only (separated from No. 1-3 when theta_W varies by age group)
    - source: [["S"],["waned"],"WILD",["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["waned"],["WILD", "ALPHA", "DELTA"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]],
          [["WILD"], ["ALPHA"], ["DELTA"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        ["1","1","1","1"],
        ["alpha","1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1"],
        ["1","chi1", "chi2"],
        ["thetaW_age0to17", "thetaW_age18to64", "thetaW_age65to100"]
      ]

# 4B. Susceptibles (S) to Exposed (E) to OMICRON for waned only (separated from No. 4 when immune_escape varies with OMICRON)
    - source: [["S"],["waned"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["waned"],["OMICRON"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]],
          [["OMICRON"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        ["1","1","1","1"],
        ["alpha","1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1"],
        ["chi3"],
        ["thetaW_age0to17_OMICRON", "thetaW_age18to64_OMICRON", "thetaW_age65to100_OMICRON"]
      ]

# 4C. Recovered (R) to Exposed (E) to OMICRON only (separated from No. 4 when theta_W varies with OMICRON)
    - source: [["R"],["unvaccinated", "1dose","waned"],["WILD", "ALPHA", "DELTA"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],"previousinfection","OMICRON",["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["OMICRON"], ["OMICRON"], ["OMICRON"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        ["1","1","1","1"],
        ["alpha","1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["theta2_OMICRON", "theta2_OMICRON", "theta2_OMICRON"],
        "chi3",
        ["1","1","1"]
      ]

# 4C. Recovered (R) to Exposed (E) to OMICRON only (separated from No. 4 when theta_W varies with OMICRON)
    - source: [["R"],["2dose"],["WILD", "ALPHA", "DELTA"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["2dose"],"OMICRON",["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
          ],
          [["OMICRON"], ["OMICRON"], ["OMICRON"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        ["1","1","1","1"],
        ["alpha","1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1"],
        "chi3",
        ["theta2_OMICRON", "theta2_OMICRON", "theta2_OMICRON"]
      ]

# 5. Waned (W) to Exposed (E), among unvaccinated/1dose/waned and all variant groups
#    Note: assumes VE of natural infection (thetaW) > first vacc dose (theta1_*)
#    - unvacc and 1dose not possible to be in W
    - source: [["W"],["unvaccinated", "1dose", "waned"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],"previousinfection",["WILD"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["WILD"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        "1",
        ["1"],
        ["thetaW_age0to17", "thetaW_age18to64", "thetaW_age65to100"]
      ]

# 5. Waned (W) to Exposed (E), among unvaccinated/1dose/waned and all variant groups
#    Note: assumes VE of natural infection (thetaW) > first vacc dose (theta1_*)
#    - unvacc and 1dose not possible to be in W
    - source: [["W"],["unvaccinated", "1dose", "waned"],["WILD", "ALPHA"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],"previousinfection","ALPHA",["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["ALPHA"], ["ALPHA"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        "1",
        "chi1",
        ["thetaW_age0to17", "thetaW_age18to64", "thetaW_age65to100"]
      ]

# 5. Waned (W) to Exposed (E), among unvaccinated/1dose/waned and all variant groups
#    Note: assumes VE of natural infection (thetaW) > first vacc dose (theta1_*)
#    - unvacc and 1dose not possible to be in W
    - source: [["W"],["unvaccinated", "1dose","waned"],["WILD", "ALPHA", "DELTA"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],"previousinfection","DELTA",["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["DELTA"],["DELTA"],["DELTA"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        "1",
        "chi2",
        ["thetaW_age0to17", "thetaW_age18to64", "thetaW_age65to100"]
      ]

# 5_om. Waned (W) to Exposed (E), among unvaccinated/1dose/waned and OMICRON
#    Note: assumes VE of natural infection (thetaW) > first vacc dose (theta1_*)
#    - unvacc and dose1 not possible to be in W
    - source: [["W"],["unvaccinated", "1dose","waned"],["WILD", "ALPHA", "DELTA"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],"previousinfection","OMICRON",["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["OMICRON"], ["OMICRON"], ["OMICRON"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        "1",
        "chi3",
        ["thetaW_age0to17_OMICRON", "thetaW_age18to64_OMICRON", "thetaW_age65to100_OMICRON"]
      ]

# 6-WILD. Waned (W) to Exposed (E), among 2dose and all variants
#    Note: assumes VE among 2dose does not change following natural infection (right?)
    - source: [["W"],["2dose"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["2dose"],["WILD"],["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]],
          [["WILD"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1"],
        ["theta2_WILD"],
        ["1","1","1"],
      ]

# 6-ALPHA. Waned (W) to Exposed (E), among 2dose and all variants
#    Note: assumes VE among 2dose does not change following natural infection (right?)
    - source: [["W"],["2dose"],["WILD", "ALPHA"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["2dose"],"ALPHA",["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]],
          [["ALPHA"], ["ALPHA"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1"],
        "chi1*theta2_ALPHA",
        ["1","1","1"],
      ]

# 6-DELTA. Waned (W) to Exposed (E), among 2dose and all variants
#    Note: assumes VE among 2dose does not change following natural infection (right?)
    - source: [["W"],["2dose"],["WILD", "ALPHA", "DELTA"],["age0to17", "age18to64", "age65to100"]]
      destination: [["E"],["2dose"],"DELTA",["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [["I1","I2","I3"]],
          [["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]],
          [["DELTA"], ["DELTA"], ["DELTA"]],
          [["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"], ["age0to17", "age18to64", "age65to100"]]
        ]
      ]
      proportion_exponent: [
        [["1"],"1","1","1"],
        [["alpha"],"1","1","1"]]
      rate: [
        ["r0 * gamma"],
        ["1"],
        "chi2*theta2_DELTA",
        ["1","1","1"],
      ]

# NEW 6_om. Recovered (R) and Waned (W) to Exposed (E), among 2dose/prev_inf and OMICRON
#    Note: assumes VE among 2dose does not change following natural infection (right?)
    - source: [["R","W"],["2dose", "previousinfection"],["WILD", "ALPHA", "DELTA"],["age0to17", "age18to64", "age65to100"]]
      destination: ["E",["2dose", "previousinfection"], "OMICRON", ["age0to17", "age18to64", "age65to100"]]
      proportional_to: [
        "source",
        [
          [
            ["I1","I2","I3"],
            ["I1","I2","I3"]
          ],
          [
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"],
            ["unvaccinated", "1dose", "2dose", "waned", "previousinfection"]
          ],
          [["OMICRON"], ["OMICRON"], ["OMICRON"]],
